Disc jockey Dave Garver attracts the amorous attentions of a demented fan named Evelyn Draper. Evelyn lets Dave pick her up at a bar; later at her apartment Evelyn admits that she is the cooing caller who repeatedly asks Dave to play the Erroll Garner classic &quot;Misty.&quot; From then on, the film is a lesson in how one casual date can turn your whole life around. Evelyn stalks Dave everywhere, ruins his business lunch, assaults his maid, mutilates his house and all of his belongings, and finally threatens to butcher his girlfriend Tobie Williams. You'll never be able to hear that song again without looking over your shoulder.

